using System;\nusing System.Collections.Generic;\n\nclass Program\n{\n    static void Main()\n    {\n        Dictionary<string, string> headers = new Dictionary<string, string>();\n        \n        headers.Add("Value of X", "Some value");\n        headers.Add("Summary of Analyse & XYZ Reports", "Some summary");\n        headers.Add("Header_with_special_chars_@_#", "Special value");\n        \n        foreach (var header in headers)\n        {\n            Console.WriteLine($"{header.Key}: {header.Value}");\n        }\n    }\n}